import React from "react";
import { render } from "react-dom";
import { BrowserRouter, Route } from "react-router-dom";
import Main from './'


render(
  <React.StrictMode>
   <BrowserRouter>
   <Route path="/" component={Main} />
   </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
